        public static void readdata(string filename, bool encrypt)
        {
            SimpleAES aes = new();
            const Int32 BufferSize = 128;
            data = new();
            string[] ColumnNames = (string[])Enum.GetNames(typeof(eDataColumn));
            DataRow dr;

            foreach (var item in ColumnNames)
            {
                switch (item)
                {
                    //case "TB":
                    //     DT.Columns.Add(item, typeof(double));
                    //     break;
                    default:
                        data.Columns.Add(item);
                        break;
                }
            }

            if (File.Exists(filename))
            {
                using FileStream fileStream = File.OpenRead(filename);
                using StreamReader streamReader = new(fileStream, Encoding.UTF8, true, BufferSize);
                streamReader.ReadLine(); // first line is column headings
                string line;
                while ((line = streamReader.ReadLine()) != null)
                {
                    string[] splits = line.Split(new char[] { ',' });
                    {
                        dr = data.NewRow();

                        for (int i = 0; i < ColumnNames.Length; i++)
                        {
                            switch (ColumnNames[i])
                            {
                                case "TB":
                                    if (encrypt)
                                    {
                                        string str = aes.DecryptString(splits[i]);
                                        if (double.TryParse(str, out double res))
                                            dr[i] = res;
                                    }
                                    else
                                        dr[i] = splits[i];
                                    break;

                                default:
                                    if (encrypt)
                                        dr[i] = aes.DecryptString(splits[i]);
                                    else
                                        dr[i] = splits[i];
                                    break;
                            }
                        }
                    }
                    data.Rows.Add(dr);
                    //Debug.Print(dr[0].ToString());
                }
            }
            else
            {
                MessageBox.Show("Data File Does Not Exist", "Data File", MessageBoxButtons.OK);
            }
        }

        public static void writedata(string filename, bool encrypt)
        {
            if (File.Exists(filename))
                File.Delete(filename);

            SimpleAES aes = new();

            using FileStream fileStream = File.OpenWrite(filename);
            using StreamWriter streamWriter = new(fileStream, Encoding.UTF8);
            string line;

            for (int i = 0; i < data.Rows.Count; i++)
            {
                line = "";
                if (encrypt)
                    line += aes.EncryptToString(data.Rows[i][0].ToString());
                else
                    line += data.Rows[i][0].ToString();

                for (int n = 1; n < data.Columns.Count; n++)
                {
                    if (encrypt)
                        line += "," + aes.EncryptToString(data.Rows[i][n].ToString());
                    else
                        line += "," + data.Rows[i][n].ToString();
                }
                streamWriter.WriteLine(line);
            }
        }
